class MDMServiceTest {
    val mdmConfigService =
        mockk<MDMConfigService> {
            every { getReceivingApplication(any()) } returns "TenantApplication"
        }
    val mockTenant =
        mockk<Tenant> {
        }
    val mdmService = MDMService(mdmConfigService)

    @Test
    fun `works for basic cases with nulls`() {
        val ident =
            Identifier(
                value = "mrn".asFHIR(),
                system = Uri("mrnSystem"),
            )
        val patient =
            Patient(
                identifier =
                    listOf(
                        ident,
                    ),
            )
        val practIdent =
            Identifier(
                value = "NPIn".asFHIR(),
                system = Uri("NPISystem"),
            )
        val practitioner = Practitioner()
        val documentReference =
            DocumentReference(
                status = Code(DocumentReferenceStatus.CURRENT.code),
                date = Instant("2015-02-07T13:28:17.239+02:00"),
            )
        every { mdmConfigService.getIdentifiersToSend(tenant = mockTenant, any()) } returns listOf(ident)
        every { mdmConfigService.getDocumentTypeID(tenant = mockTenant) } returns "documentIDType"
        every {
            mdmConfigService.getPractitionerIdentifierToSend(
                tenant = mockTenant,
                identifiers = any(),
            )
        } returns practIdent
        val message = mdmService.generateMDM(patient, practitioner, documentReference, mockTenant)
        assertEquals("RONIN", message.msh.sendingApplication.namespaceID.value)
        assertEquals("TenantApplication", message.msh.receivingApplication.namespaceID.value)
        assertNotNull(message.msh.dateTimeOfMessage)
        assertEquals("T02", message.evn.eventTypeCode.value)
        assertEquals("20150207132817", message.evn.recordedDateTime.time.value)
        assertTrue(message.pid.patientIdentifierList.size == 1)
        assertEquals("mrn", message.pid.patientIdentifierList.first().idNumber.value)
        assertEquals("MRN", message.pid.patientIdentifierList.first().assigningAuthority.namespaceID.value)
        assertEquals("U", message.pV1.patientClass.value)
        assertEquals("documentIDType", message.txa.documentType.value)
        assertEquals("20150207132817", message.txa.activityDateTime.time.value)
        assertEquals("Project", message.txa.originatorCodeName.first().familyName.surname.value)
        assertEquals("Ronin", message.txa.originatorCodeName.first().givenName.value)
        assertTrue(message.txa.uniqueDocumentNumber.universalID.value.startsWith("Ronin"))
        assertEquals("AU", message.txa.documentCompletionStatus.value)
        assertEquals("U", message.txa.documentConfidentialityStatus.value)
        assertEquals("AV", message.txa.documentAvailabilityStatus.value)
    }

    @Test
    fun `works for basic cases with some values`() {
        val ident =
            Identifier(
                value = "mrn".asFHIR(),
                system = Uri("mrnSystem"),
            )
        val patient =
            Patient(
                identifier =
                    listOf(
                        ident,
                    ),
                name =
                    listOf(
                        HumanName(
                            use = Code(NameUse.NICKNAME.code),
                            family = "Goodman".asFHIR(),
                            given = listOf("Saul".asFHIR()),
                        ),
                        HumanName(
                            use = Code(NameUse.OFFICIAL.code),
                            family = "McGill".asFHIR(),
                            given = listOf("Jimmy".asFHIR()),
                        ),
                    ),
                address =
                    listOf(
                        Address(
                            city = "Albuquerque".asFHIR(),
                            state = "NM".asFHIR(),
                            postalCode = "87102".asFHIR(),
                            line = listOf("200 3rd St NW".asFHIR()),
                            country = "USA".asFHIR(),
                        ),
                        Address(
                            city = "Omaha".asFHIR(),
                            state = "NE".asFHIR(),
                            postalCode = "68114".asFHIR(),
                            line = listOf("120 Regency Pkwy".asFHIR()),
                        ),
                    ),
                telecom =
                    listOf(
                        ContactPoint(
                            use = Code(ContactPointUse.MOBILE.code),
                            value = "1 595 503 4455".asFHIR(),
                        ),
                    ),
                birthDate = Date("1960-11-12"),
                gender = Code("Male"),
            )
        val practIdent =
            Identifier(
                value = "NPI".asFHIR(),
                system = Uri("NPISystem"),
            )
        val practitioner =
            Practitioner(
                name =
                    listOf(
                        HumanName(
                            use = Code(NameUse.OFFICIAL.code),
                            family = "McGill".asFHIR(),
                            given = listOf("Chuck".asFHIR()),
                        ),
                    ),
            )
        val documentReference =
            DocumentReference(
                status = Code(DocumentReferenceStatus.CURRENT.code),
                date = Instant("2015-02-07T13:28:17.239+02:00"),
                content =
                    listOf(
                        DocumentReferenceContent(
                            attachment =
                                Attachment(
                                    data =
                                        @Suppress("ktlint:standard:max-line-length")
                                        Base64Binary(
                                            value = "",
                                        ),
                                ),
                        ),
                    ),
                relatesTo =
                    listOf(
                        DocumentReferenceRelatesTo(
                            code = Code(DocumentRelationshipType.APPENDS.code),
                            target = Reference(reference = "DocumentReference/parentID".asFHIR()),
                        ),
                    ),
            )
        every { mdmConfigService.getIdentifiersToSend(tenant = mockTenant, any()) } returns listOf(ident)
        every { mdmConfigService.getDocumentTypeID(tenant = mockTenant) } returns "documentIDType"
        every {
            mdmConfigService.getPractitionerIdentifierToSend(
                tenant = mockTenant,
                identifiers = any(),
            )
        } returns practIdent
        val message = mdmService.generateMDM(patient, practitioner, documentReference, mockTenant)
        assertEquals("T08", message.evn.eventTypeCode.value)
        assertEquals("McGill", message.pid.patientName.first().familyName.surname.value)
        assertEquals("Jimmy", message.pid.patientName.first().givenName.value)
        assertEquals("M", message.pid.administrativeSex.value)
        assertEquals("19601112", message.pid.dateTimeOfBirth.time.value)
        assertEquals("200 3rd St NW", message.pid.patientAddress.first().streetAddress.streetOrMailingAddress.value)
        assertEquals("Albuquerque", message.pid.patientAddress.first().city.value)
        assertEquals("NM", message.pid.patientAddress.first().stateOrProvince.value)
        assertEquals("87102", message.pid.patientAddress.first().zipOrPostalCode.value)
        assertEquals("USA", message.pid.patientAddress.first().country.value)
        assertEquals("1 595 503 4455", message.pid.phoneNumberHome.first().telephoneNumber.value)
        assertEquals("ORN", message.pid.phoneNumberHome.first().telecommunicationUseCode.value)
        assertEquals("McGill", message.txa.primaryActivityProviderCodeName.first().familyName.surname.value)
        assertEquals("Chuck", message.txa.primaryActivityProviderCodeName.first().givenName.value)
        assertEquals("parentID", message.txa.uniqueDocumentNumber.universalID.value)
        assertTrue(((message.observationAll[0].obx.observationValue[0].data as TX).value).startsWith("Lorem ipsum"))
        assertTrue(((message.observationAll[1].obx.observationValue[0].data as TX).value).startsWith("Orci varius"))
    }

